import styled from "styled-components";

export const HomeWrapper = styled.div`
    width:960px;
    height:300px;
    margin: 0 auto;
    background:pink;
`
export const HomeRight = styled.div`
    width:625px;
    margin-left:15px;
    padding-top: 30px;
    .banner-imp

`
export const HomeLeft = styled.div`
    width:240px;
    background:blue;

`
